import styled from 'styled-components';
import { Card } from '../Cards/CardElements';

export const Image = styled.img`
    margin-top: -20px;
    width : 225px;
    height: 175px;

`

export const Subject = styled(Card)`
    width : 225px;
    height : 250px;
    border-radius : 0;
    margin: 3%;
`
